Review.create!  :id => 889,  :organization_id => 323,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-09-10",  :body => "Hier niemals bestellen!!! Wir bestellten online Samstag Abend viertel nach Acht.
Als das Essen nach 1,5 Stunden noch nicht da war, rief ich an. Oh, wir haben leider kein Telefon, kein Fax, kein Internet. Telefon ist umgeleitet, bitte geben Sie nochmal telef. durch, in 20 min sind wir da. Htten wir der Dame am Telefon nur nicht geglaubt. Das Essen kam genau nach nochmal 45 min.
Der Fahrer wusste von keinem techn. Problem. Aha, die Dame hatte wohl gelogen? Wenn das Essen wenigstens noch toll gewesen wre. Nein, berhaupt nicht. Es war 0-8-15, jeder Asia-Stand kocht leckerer. Aber damit sollte der rger noch nicht zu Ende sein. Es wurde auch tlw. noch falsch geliefert. Wir bekamen zweimal nicht bestellte Peking-Suppe, aber die Erdnuss-Chili-Soe wurde vergessen. Eine gerstete Ente mit einem Teelffel voll Krautsalat und das ohne Soe fr 13,40 . So was anzubieten ist eine Frechheit. Ich rief sofort wieder an, aber ich hatte es schwer, denn die Angestellte am Telefon strotzte nur so vor Unhflichkeit und lie mich nicht ausreden. Es tut mir leid. Das glaube ich nicht. Dann htte man nach so langer Wartezeit eine Entschdigung erwarten knnen. Aber nein, man liefert auch noch falsch. Und dann noch ein Essen was nicht berzeugen konnte. Dieser Laden sollte mal seine Hausaufgaben machen und das in jeder Beziehung.",  :rating => "1.0",  :processed => "",  :created_at => "2012-02-16 22:49:01 UTC",  :updated_at => "2012-02-16 22:49:01 UTC",  :reviewer_id => 740,  :review_provider_id => "2374681",  :title => "",  :review_url => ""
