Review.create!  :id => 924,  :organization_id => 322,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-01-17",  :body => "Ich habe hier fters den Mittagstisch ausprobiert und den kann empfehlen. Die freundliche Frau vom Tresen steht relativ schnell vor einem und dann dauert es auch nicht lange, bis die Suppe (Peking, Sauer-Scharf) vor einem dampft. Es gibt eine reichhaltige Auswahl an Gerichten fr den Mittagstisch, auch vegetarische (Buddhistische Fastenspeise) und Fisch in unterschiedlichen Arten. Ich hatte hier s-saueren Fisch und Fisch mit Bambus und chinesischen Pilzen (beide 5,60), dazu gibt\'s meist einen grnen Tee (2,10). Wenn man in der Nhe der Kche sitzt, kann man schon die Gerusche vernehmen, wie der Koch das eigene Essen zubereitet.Da man in vielen Asia-Imbissen auch schnell bei 7 bis 9 landet, ohne dass jemand einem die Speisen nett an den Tisch bringt und dazu noch ein doppeltes Teelicht zum Warmhalten von Reis und Haupgericht, finde ich dieses China-Restaurant sehr gut. Parkmglichkeiten gibt es in der Umgebung, aber aufgepasst fr einige ist ein Parkschein erforderlich. Die nchste U-Bahn ist Dehnheider bzw. Hamburger Strae, dort gibt es auch Busse.",  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:49:50 UTC",  :updated_at => "2012-02-16 22:49:50 UTC",  :reviewer_id => 773,  :review_provider_id => "1811908",  :title => "",  :review_url => ""
