Review.create!  :id => 930,  :organization_id => 322,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2009-08-15",  :body => "Ganz simpel ok. Der typische deutsche Chinese um die Ecke. Von auen etwas dster und an einer lauten Hauptstrasse, aber innen sauber und ganz nett.


	Ich war auf einen Mittagstisch (gebratene Nudeln mit obligatorischer Suppe und Schnaps vorweg) dort und das Essen war vllig in Ordnung. Das Restaurant war fr Mittags verblffend voll und die nette Servierkraft hat mich leider beim Hauptgang vergessen (war aber sonst absolut schnell), sonst gibt es nur nettes zu berichten. Portion lecker und reichlich, Preis/Leistung absolut ok.


	Das werde ich wahrscheinlich hufiger besuchen.",  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:49:50 UTC",  :updated_at => "2012-02-16 22:49:50 UTC",  :reviewer_id => 779,  :review_provider_id => "1011849",  :title => "",  :review_url => ""
