Review.create!  :id => 931,  :organization_id => 322,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2007-05-16",  :body => 'Nachtrag vom 16.11.2007:War letzten Dienstag mal wieder zum Mittagstisch hier. Zu meiner berraschung war das Restaurant proppevoll mit Rentnern, Handwerkern und Vertretern des Typs "Schlemihl" (hey, du. willst du eine 8 kaufen?), die mal flott zum Chopsuey Ihrem Kunden noch einige Vertrge unterjubeln.


	Dann der Patzer: ich bestelle nicht wie blich das knusprige Hhnerfleisch, sondern wage (mittlerweile QYPE-versaut) einen Vorstoss und bestelle Scampis mit Champignons.


	Tatschlich ist der Teller den ich bekomme bervoll mit Scampies. Hurra! Aber leider sind die Teile allesamt wssig und labberig. Gleiches gilt fr die Pilze. Hmm, von zerkochten Scampis stand nichts in der Karte und gleich wie die Zubereitung auch geplant war, htte ich mir etwas Biss erwartet.


	Nee, das war heute gar nichts. Einzig die obligatorische und immer gleiche Vorsuppe, ging o.k.. Ich muss vorerst von drei auf zwei Sterne reduzieren. Dafr habe ich in den letzten Wochen zuviele andere, gute Lden besucht und hier bewertet.


	----Erster Beitrag vom 09.05.2007:Tja, jahrelang dachte ich das ist nur eine Geldwaschanlage - nur um so mal ein gngiges Klischee zu bedienen; das grosse, aber etwas spartanische und veralgte Aquarium unterstrich meinen subjektiven Eindruck.


	Ich bin dann aber nach rund 10 Jahren des Vorberschreitens an dieser von auen recht dunklen "Hhle" einmal zum Mittagstisch dort eingeht und siehe da: hier gibts ganz passables Essen zu sehr moderaten Preisen. Die chinesische Kche wurde hier sicherlich nicht erfunden, aber es schmeckt und man wird satt. Ein klassischer Deutsch-Chinese eben.Seit dem bin ich unregelmg regelmig hier und bestelle immer das Gleiche: Gebratenes Hhnerfleisch mit sieben Kostenbarkeit. Dazu ein Spezi ohne Eis.


	Ein Blick auf die Herrentoilette (bekanntermaen gilt: wenn schon die Toiletten nicht sauber sind, kann es mit der Kchenhygiene auch nicht weit her sein) gibt Aufschluss: eine rundum sauber Sache.


	Kritikpunkte? 1. Ich wrde am dsteren Aussehen von der Strasse her was machen. Demnach sieht das Haus immer leer bzw. geschlossen aus. 2. Das Koi-Becken ist ein trauriger Anblick. Das geht besser. 3. Die charmanten Damen vom Service sind so aufmerksam, dass sie einem den beendeten Teller noch vor Niederlegen der Gabel unter den Augen wegreissen (mglicherweise aber auch nur ein Fall von Porzellanmangel). Meine Damen: in der Ruhe liegt die Kraft - sagte schon Konfuzius (oder wars Sokrates?).',  :rating => "2.0",  :processed => "",  :created_at => "2012-02-16 22:49:50 UTC",  :updated_at => "2012-02-16 22:49:50 UTC",  :reviewer_id => 780,  :review_provider_id => "51027",  :title => "",  :review_url => ""
