	alles in allem ist es  ok das essen, der preis fr das Buffet von 7,30  ist etwas zu hoch.in der gleichen auswahl bekommt man es schon fr 5,00 - 6,00  in der innenstadt und auch der wandsbeker umgebung.",  :rating => "3.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 783,  :review_provider_id => "2047402",  :title => "",  :review_url => ""
