Review.create!  :id => 935,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-02-13",  :body => 'Da wir in der Weihnachtszeit recht spontan Besuch bekamen und unser "Stamm-Chinese" komplett ausgebucht war, entschieden wir uns, dieses Restaurant zu probieren, da es immer ziemlich einladend auf uns wirkte. Wir hatten den Tisch fr einen Freitag um 19 Uhr reserviert. Das Restaurant war fast komplett leer. Zur Begrung gab es einen kleinen Pflaumenwein. Dann gingen wir zum Buffet. Die "frischen" Zutaten, die man dort auch braten lassen kann, waren wohl ein paar Stunden zuvor frisch. Das Fleisch war angetrocknet und es flogen ein paar Fliegen umher. Der erste Eindruck war schonmal schlecht. Auch der Rest vom Buffet war nicht zu unserer Zufriedenheit. Die Schalen waren leer, manche wurden in der gesamten Zeit, wo wir dort waren, nicht aufgefllt. Man musste Glck haben, um berhaupt verschiedene Speisen zu bekommen. Das Essen hat aber geschmeckt (jedenfalls das, was wir bekommen haben). Aber: In der ersten Etage befindet sich eine "Shisha Lounge" oder sowas in der Art. Permanent gingen die "Besucher" in den Keller (Treppe befindet sich direkt im Restaurant), wo sich die Toiletten befinden (immer die selben 5). Wrend diese normal hinuntergingen, kamen sie teilweise ohne Hilfe die Treppen nicht mehr rauf, was auch immer die sich da unten reingepfiffen haben. Ich wei nicht, ob sowas unbedingt zum guten Ruf beitrgt, wenn man beim Essen solche Szenen beobachtet. Wir werden dieses Restaurant nie wieder besuchen. Erstens auf Grund des Essens bzw. der nicht vorhandenen Auswahl und zweitens auf Grund unserer Beobachtungen, was sich in der ersten Etage bzw. in den Toiletten so abspielt. Zwei Sterne gibt es trotzdem, da das Essen dennoch geschmeckt hat.',  :rating => "2.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 784,  :review_provider_id => "1874748",  :title => "",  :review_url => ""
