Review.create!  :id => 936,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-01-16",  :body => "Aufgrund der positiven Bewertungen hier und eines Artikels in meinem Wochenblatt war ich mit Bekannten und meinen Liebsten gestern dort essen. Abendbuffet fr 13.90 EuroEs ging damit los, dass die Tischdecke dreckig war (Flecken von Sojasauce o..)Die Atmosphre ungemtlich. An einem Tisch sa das Personal am Notebook.ber unserm Tisch kreisten die Fruchtfliegen. Es gab mehrere leere Schalen am Buffet der Rest war Trocken und fast kalt kaum Fleisch.  Die Bedienung na ja.Nachtisch wurde erst auf Verlangen nachgefhlt.Da ich regelmig Essen gehe ca. 2-mal die Woche kann ich nur sagen dieses Restaurant ist mangelhaft so schlecht habe ich noch nie in mein Leben gegessen. Fr 13.90 Euro kann der Kunde mehr erwarten. Ich kann nur jedem abraten dort zu Essen schade uns schne Geld. Wo bleibt heut zu Tage die Qualitt ist den alles nur noch auf Gewinn ausgerichtet. In einer kleinen Stadt wrde dies Restaurant nicht lange berleben. Hier in Hamburg macht es glaube ich die Laufkundschaft.PS. Nicht einmal Kartenzahlung ist dort mglich und das im Einundzwanzigste Jahrhundert.",  :rating => "1.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 785,  :review_provider_id => "1809123",  :title => "",  :review_url => ""
