Review.create!  :id => 937,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2010-12-30",  :body => "Wir waren schon einige Male bei Zhong Hua. Ok, die Tischdecken wrden eine ftere Reinigung vertragen, aber das Essen ist wirklich lecker und dem Preis angemessen.Es gibt Sushi (wenn auch nur ein bis zwei Sorten), Ses zum Nachtisch und das bliche chinesische Essen vom Buffet. Zustzlich gibt es noch 11 frische Zutaten, die man mit mehreren verschiedenen Saucen frisch zubereiten lassen kann.Die Getrnke werden auf Knopfdruck gebracht, genau wie die Rechnung, da an jedem Platz ein Rufknopf angebracht ist.Bisher wurden wir nie enttuscht. Nichts fr einen romatischen Abend, aber gut um lecker chinesisch essen zu gehen.",  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 772,  :review_provider_id => "1771413",  :title => "",  :review_url => ""
