Review.create!  :id => 938,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2010-11-17",  :body => 'Vor ein paar Tagen waren wir im Zhong Hua zum Mittagsbuffet essen. 6,80 (ohne Getrnke) fanden wir dafr angemessen, daher ist das Preis-Leistungsverhltnis vllig ok.


	Lage
	Das Restaurant befindet sich sehr nah an der U-Bahnhaltestelle U1 Wandsbek Markt, sodass man zu Fu ca. 5 Minuten bentigt.


	Service
	Uns bediente eine nette Dame, die uns anfangs eine freie Platzwahl anbot. Zur Begrung bekamen wir zu unserem bestellten Getrnk einen Pflaumenwein gratis dazu. Die Bedienung war nett und zuvorkommend.


	Essen
	Die Auswahl an verschiedenen Gerichten war recht gro. Das Personal bemhte sich, die Gerichte immer schnell wieder nachzufllen. Das Essen war warm.Geschmacklich hat es uns gefallen. Einige der Speisen waren jedoch recht scharf, aber nicht als solche ausgezeichnet. Anhand der kleinen roten Chilistcke konnte man es aber erkennen.Am Mittagsbuffet vermissten wir aber die "Klassiker", die gebratene Ente oder auch die Erdnusssoe.


	Ambiente
	Als Hintergrundmusik lief eine Art Chillout-Musik, die nicht wirklich chinesisch klang. Ansonsten war auch unsere Tischdecke ziemlich befleckt, obwohl der Tisch neu eingedeckt war, als wir ankamen. Das fanden wir seltsam und dadurch entstand eher eine Imbiss-Atmosphre als eine Restaurant-Atmosphre.Die Einrichtung war fr chinesische Restaurants in Deutschland typisch: ein paar Buddhas, chinesische Gemlde, ein Aquarium und Orchideen.',  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 786,  :review_provider_id => "1695006",  :title => "",  :review_url => ""
