Review.create!  :id => 939,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2010-06-03",  :body => 'Im stliche Teil Hamburgs, vom Quarree Einkaufzentrum etwa fnf Minuten zu Fu stadtauswrts findet sich das "Zhong Hua".


	Von der Erscheinung her ist\'s eher ein unscheinbares, eher typisches chinesisches Restaurant. Was der Betrachter jedoch auf den ersten Blick nicht weiss - hier wird leckeres chinesisches Frhstck angeboten - nmlich an Wochenenden und Feiertags =)


	Mehr Infos zum Essen vermitteln die Fotos - ein Bild sagt ja bekanntlich mehr als tausend Worte.',  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 787,  :review_provider_id => "1379856",  :title => "",  :review_url => ""
