Review.create!  :id => 940,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2010-02-28",  :body => 'Wir waren heute zum ersten Mal im Zhuang Hua und sind richtig enttuscht. Haben das Buffet ausprobiert und insgesamt 31 Euro bezahlt. 31 Euro zu viel. Ich kann mich "Frau Schlau" nur anschlieen. Die Tischdecken waren dreckig (zwar hat man versucht durch umgedrehte Tischdecken die Flecken zu verstecken, leider hat es nicht funktioniert), die Atmosphre ungemtlich. An einem runden groen Tisch sa das Personal und brachte sich nach und nach frische Speisen an ihren Tisch, dafr gab es mehrere leere Schalen am Buffet. Die Reste, die sich vermutlich noch vom Mittagstisch in den Behltern am Buffet befanden, waren kalt und teilweise trocken, da kein Deckel drauf war. Zwar wurde uns gesagt, dass wenn etwas leer ist und wir Nachschlag mchten, Bescheid sagen sollen, aber als ich dann bat, noch etwas Sushi (es gab 2 Sorten) nachzuliefern (es befanden sich noch 4 Stck, die nicht mehr so gut aussahen in der Schale) gab es unter dem Personal erstmal eine Diskussion, da der Koch wohl der Meinung war, dass da ja noch etwas sei. Dann wurde tatschlich eine minimale Menge nachgeliefert. Von den Maki sage und schreibe 8 Stck.Die 3 Gurkenscheiben, die es noch in der Salatschale gab, waren am Rand gelb und trocken. Tomaten waren nur noch Kerne da. Da hab ich mich auch gar nicht mehr getraut, Bescheid zu sagen, dass ich noch was mchte.Die frischen Zutaten, die separat an einem Buffet lagen, waren von der Auswahl her auch eher mager. Den Fisch (z.B. die trockenen rohen Garnelen und den Rest des Fisches) habe ich mich gar nicht getraut zu essen, weil ich keine Lust auf Magenverstimmung hatte. Sah wirklich unappetitlich aus, auch das Fleisch. In Plastikschalen lag etwas Fleisch und getrocknetes Blut war drum herum. Ich finde 13,30 definitiv zu viel fr dieses Buffet. Wir werden mit Sicherheit nie wieder hingehen und hoffen, dass wir heute Nacht keine Magen-Darm-Verstimmung bekommen.Leider habe ich den Beitrag von "Charles" eben erst gelesen. Mit den Stbchen, die wieder verwendet werden, obwohl sie aus Holz sind, stimmt nmlich auch.',  :rating => "1.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 788,  :review_provider_id => "1246188",  :title => "",  :review_url => ""
