Review.create!  :id => 946,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2008-02-12",  :body => "Aufgrund der beiden positiven Bewertungen hier und eines Artikels in meinem Wochenblatt war ich mit meinem Liebsten gestern hier essen.


	Und leider kann ich mich den Vorredner nicht anschliessen. Ich kannte dieses Konzept schon aus Berlin und habe dort fr 10,- pauschal wesentlich besser gegessen, was Qualitt und Auswahl angeht.


	Zum Ambiente muss man in einem China Restaurant nix sagen, das ist vermutlich nie gemtlich.


	Es ging damit los, dass die Tischdecke dreckig war (Flecken von Sojasauce o..) und ich finde WENN Tischdecke, DANN schon SAUBER! :-)


	Das Buffet hat mich berhaupt nicht berzeugt, beim mongolischen Buffet war extrem wenig Gemseauswahl, grossartige Zusammenstellungen konnte man da nicht machen (Poree, Zwiebeln, Sojasprossen, Bambus und Champignons). Man konnte sich diese Speisen mit 10 verschiedenen Saucen zubereiten lassen, die beiden Saucen, die ich probiert habe (Barbeque und Knoblauch) schmeckten wenig intensiv und wsserig.


	Das normale chinesische Buffet lebte von viel frittiertem, dass wohl schon lnger lag und recht fettig und trocken war (man kann ja auch gut frittieren). Die gebackenen Bananen lagen zwischen der frittierten Ente und dem Bratreis ?! Dazu kam, dass das Buffet hchstens 1/3 gefllt war als wir um 18 Uhr kamen, obwohl die 3 anderen besetzten Tische gar nicht vom Buffet bestellt hatten, sondern aus der Kche... Es wurde dann nach und nach aufgefllt, aber diese Speisen schmeckten irgendwie alle gleich. Reis bekamen wir auch nicht an den Tisch, sondern mussten wir uns holen.


	Das Sushi, was echt nicht gut schmeckte, habe ich erst spt gesehen, da es mit in der Desserttruhe lag...


	Das Konzept mit den frischen Speisen und Saucen in dem Moment zubereitet finde ich toll, funktioniert aber nur, wenn es auch entsprechende Auswahl gibt.


	Ich versuche dann mal als nchstes das Mongos.",  :rating => "1.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 793,  :review_provider_id => "138905",  :title => "",  :review_url => ""
