Review.create!  :id => 947,  :organization_id => 326,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2007-12-22",  :body => "Eine Woche nach dem wir hier unsere Weihnachtsfeier hatten, nun auch die berfllige Bewertung.


	Erstaunlicher Weise war der Laden relativ leer, was aber vermutlich nicht immer so ist, da es Pltze ber 2 Stockwerke gibt. Nun am Montag waren auf jedenfall nur einige wenige Gste da so, das wir uns also nicht ber mangelnde Aufmerksamkeit beim Getrnkebestellen beschweren konnten.


	Beim essen war es noch einfacher, da 15 von 16 Personen sich am Buffet bedient haben.


	1 Essen von Karte war aber auch dabei, so das ich auch ber diese sagen kann, lecker und groe Portionen.


	Nun aber zum Buffet, das man in meinen Augen umbedingt nehmen sollte.


	Es besteht aus 3 unterschiedlichen Bereichen


	1) SushiIch bin kein Sushi Esser, aber mir wurde von allen Seiten versichert, das es sehr lecker und von hoher Qualitt war. Definitiv war es sehr frisch.


	2) Chinesisches BuffetEin Buffet wie man es von vielen Chinaimbissen kennt, nur auf hhrem Niveau und mit grerer Auswahl.Was gab es also:gebacken/fritiert: Tintenfischringe, Hhnchen, Schwein, Fisch, Banane, ChickenWings, MiniFrhlingsrollen und Sesambllchendazu gebratene Ente und Huhn.Dazu gab es Reis und Bratnudeln, Soja und S-Saure Soe, und noch verschiedenste Gerichte von der Karte (Schwein mit 7 Kstlichkeiten etc.) und 2 Suppen.


	3) Mongolisches BarbecueMein persnlicher Favorit, was ich auch schon im Mongos(http://www.qype.com/place/1809-MongoS-Duesseldorf) so toll findeMan stellt sich aus verschiedenen frischen Zutaten seinen Teller zusammen und lt sich das ganze frisch mit einer Soe nach Wahl zubereiten.


	Natrlich ist die Auswahl nicht so riesig wie im Mongos, da es ja noch andere Dinge gibt, aber man konnte schon gengend Kombinationen ausprobieren. Achtung nur beim Koch, er spricht kein Deutsch (was auch dran steht) so das es nichts bringt, im lange irgendwelche Dinge zu erklren oder versucht sich von ihm Beraten zu lassen ;-)


	Als Nachspeise wurden dann noch ein paar Eisbecher bestellt, welche gro waren, lecker aussahen und es wohl auch waren :-).


	Insgesamt ein rund um gelungener Abend, in einem tollen Restaurant mit, wie mir von unserem Koreaner im Team erklrt wurde, authentischer Kche.",  :rating => "5.0",  :processed => "",  :created_at => "2012-02-16 22:51:10 UTC",  :updated_at => "2012-02-16 22:51:10 UTC",  :reviewer_id => 794,  :review_provider_id => "115788",  :title => "",  :review_url => ""
