Review.create!  :id => 949,  :organization_id => 325,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-11-01",  :body => "Ich wollte schon lange mal das China-Restaurant Schnelsen ausprobieren. Aufgrund des recht unscheinbaren Gebudes und der vielen Alternativen in der Umgebung hatte ich bisher dieses Lokal nie aufgesucht. Auf der Speisekarte drauen konnte ich schon mal vorab die Mittagskarte studieren. Hauptgericht mit Pekingsppchen oder Frhlingsrolle fr 6,20 . Das ist echt ein Schnppchen.


Das Lokal war zur Mittagszeit wirklich gut besucht. Daher habe ich mich fr den Nebenraum entschieden. Die Einrichtung ist im typischen chinesischen Stil gehalten.


Der flinke Kellner hat mir einen Platz am Fenster empfohlen und mir eine Tageszeitung zum lesen angeboten. Ich habe mich dann fr Rindfleisch mit Zwiebeln, eine Pekingsuppe und einen grnen Tee entschieden. Schnell wurde die Suppe und der Tee serviert. Die Suppe war lecker und gut gewrzt.


Anschlieend wurde recht flott das Hauptgericht serviert. Auch sehr lecker und schmackhaft.


Insgesamt war ich sehr zufrieden mit Essen und Service. Der Kellner hatte zu vielen Gsten ein sehr freundschaftliches Verhltnis, so scheint dieser Chinese ein sehr treues Stammpublikum zu haben.",  :rating => "5.0",  :processed => "",  :created_at => "2012-02-16 22:51:44 UTC",  :updated_at => "2012-02-16 22:51:44 UTC",  :reviewer_id => 796,  :review_provider_id => "2493255",  :title => "",  :review_url => ""
