Review.create!  :id => 961,  :organization_id => 324,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2010-11-23",  :body => "Das China Restaurant Panda kenne ich schon seit Jahren. Die eine oder andere kleine Geburstagsfeier habe ich dort schon mit Familie und Freunden gefeiert. Das Restaurant ist zwar recht klein und selten voll belegt, aber wahrscheinlich ist das mit ein Grund warum ich dort gerne zum Essen hingehe.


	Die Bedienungen (Bisher habe ich dort ausschlielich chinesische Frauen, die sehr gut deutsch sprechen arbeiten gesehen) sind sehr freundlich und entgegenkommend.


	Meistens esse ich dort die Mittagstisch-Speisen, die im Durchschnitt ca. 5,50 Euro kosten. Zum Hauptgericht bekommt man als Vorspeise noch entweder eine Suppe oder Frhlingsrolle.


	Man bekommt das Essen auf einer Wrmeplatte auf die Mitte des Tisches serviert, von wo man dann seinen Teller befllt. Wenn man dann mit der Familie oder Freunden am Tisch sitzt, dann kann man auch von den Speisen probieren welche diese sich ausgesucht haben. Der Reis wird in einer seperaten Schssel auf den Tisch gestellt und wenn diese nicht reichen sollte kann man sie sich kostenlos nachfllen lassen.


	Das Essen schmeckt sehr gut und ich bin hier bisher immer pappsatt :-) rausgekommen.


	Das Panda kann ich mit gutem Gewissen weiter empfehlen.",  :rating => "5.0",  :processed => "",  :created_at => "2012-02-16 22:51:59 UTC",  :updated_at => "2012-02-16 22:51:59 UTC",  :reviewer_id => 807,  :review_provider_id => "1707365",  :title => "",  :review_url => ""
