Review.create!  :id => 962,  :organization_id => 324,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2009-10-13",  :body => "Ich war am 12.10.2009 mit einer guten Freundin im China Restaurant Panda. Der Empfang war sehr herzlich, schade, dass nur noch zwei andere Gste da waren. Die Besitzerin bediente uns persnlich und nahm sich auch Zeit fr ein Gesprch. Sie erzhlte, dass Sie Chinesin sei, jedoch in Malasya aufgewachsen ist. Da ich einmal zum Urlaub in Indonesien war und indonesich und malayisch fast identisch sind, haben wir uns - wenn auch gebrochen - auf indonesisch unterhalten. Sie war hellauf begeistert! Das Essen kam sehr schnell und schmeckte auch sehr gut. Wir waren rundum zurfrieden - besonders wegen der Gastfreundlichkeit.Wer also gutes chinesisches Essen mag und eine freundliche Atmosphre schtzt, kann beim Restaurant Panda nichts falsch machen.",  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:52:00 UTC",  :updated_at => "2012-02-16 22:52:00 UTC",  :reviewer_id => 808,  :review_provider_id => "1076273",  :title => "",  :review_url => ""
