Review.create!  :id => 965,  :organization_id => 324,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2009-02-22",  :body => "Heute habe ich beim China Restaurant Panda gerste Ente in pikanter Soe bestellt. Obwohl das Restaurant nicht weit weg von meiner Wohnung liegt, habe ich mir das Essen liefern lassen, da ich ungern alleine in Restaurants gehe.


	Es dauerte 1 Std. 20 Minuten bis das Essen kam. Das ist nun wahrlich keine Rekordzeit, ich fand es aber noch in Ordnung. Das Essen wurde vollstndig und korrekt geliefert und war zudem noch hei.


	Warum habe ich dann nur ein Stern gegeben? Ganz einfach: Weil das Essen ansonsten eine Katastrophe war. Die Ente war so unglaublich zh, dass minutenlangen Kauen von Nten war, um die Ente runter kriegen. Schon nach kurzer Zeit tat mir das Gebiss weh. Schmackhaft war die Ente leider auch nicht. Die pikante Soe htte weiterhin eher die Bezeichnung geschmacklos verdient, denn die Soe an sich schmeckte in der Tat nach nichts. Das Gemse in der Soe war okay, aber auch nichts besonderes.


	Bezahlt habe ich 14 und war natrlich sehr entschuscht. Vor 2 Jahren bin ich schon einmal bei Panda gewesen. Auch damals bin ich enttuscht wurden. Ein drittes Mal werde ich dort auf keinen Fall essen.",  :rating => "1.0",  :processed => "",  :created_at => "2012-02-16 22:52:00 UTC",  :updated_at => "2012-02-16 22:52:00 UTC",  :reviewer_id => 811,  :review_provider_id => "808622",  :title => "",  :review_url => ""
