Review.create!  :id => 968,  :organization_id => 317,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-08-27",  :body => "Ich war insgesamt dreimal in diesem Lokal und so richtig berzeugen konnte es mich nicht. Das letzte Mal war am Geburtstag meiner Mutter, zu dem wir eigentlich gegenber bei Jamjam essen wollten, aber mein Bruder hatte stattdessen bei Yamyam mit Y reserviert, das ganz woanders liegt, und so mussten wir wieder gehen. So kamen wir wieder ins Ming. Der Laden war zur normalen Abend-Essenszeit fast leer.
Es war sehr enttuschend, weil dem Essen dort einfach das gewisse Etwas fehlt. Es hat mehr von Kantinen- oder Imbissessen als von dem, was ich sonst von Chinarestaurants gewohnt bin. Viel Fettes, die blichen Geschmacksverstrker (kein Kritikpunkt, das ist normal) und insgesamt irgendwie plump. Kosten tut es aber wie Restaurantessen. Schade um das Geld.
