Review.create!  :id => 969,  :organization_id => 317,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2010-03-15",  :body => "Wahrscheinlich war ich noch nie fter bei einem Chinarestaurant als im Ming.


	-> Die Einrichtung ist super-> Die Atmosphre auch auf Grund der Musik-> Ein Familienbetrieb, irgendwann kennt man alle ^^-> Das Essen ist nicht das Beste chinesische Essen in Hamburg - klar aber es hat ein sehr gutes Preis/Leistungs Niveau.-> Die Qualitt vom Essen stimmt immer-> Es ist einer von diesen etwas europisierten Chinese, also von den Gerichten her, ernsthaft traditionell ist die Kche keineswegs-> Man findet alles, von Tellergerichten die bei 5,20 anfangen (der Mittagstisch kostet so 5,80-7,20, mit Suppe natrlich) bis hin zu 4-5 Personen Mens. Also eigentlich fr jeden was da.-> Die Bedienung war in all den Jahren immer nett und konnte auch mal ein Auge zudrcken wenn man mal etwas spter zum Mittagstisch kam.


	Ich geh dort gern hin wenn ich hunger hab, allein oder mit 1-2 Freunden aber unbedingt ein groes Festessen wrd ich doch woanders halten :) trotzdem wegen der Preis/Leistung und Lage (bin halt oft in Wandsbek) mein Favorit in Hamburg",  :rating => "5.0",  :processed => "",  :created_at => "2012-02-16 22:52:00 UTC",  :updated_at => "2012-02-16 22:52:00 UTC",  :reviewer_id => 815,  :review_provider_id => "1268151",  :title => "",  :review_url => ""
