Review.create!  :id => 970,  :organization_id => 317,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2010-03-09",  :body => "Wir warem am vergangenen Samstag zum ersten mal bei diesem Chinesen und haben uns dort den Mittagstisch gegnnt.


	Die Speisen waren frisch und lecker. Die Portionsgre fr einen Mittagstisch angemessen gro.


	Leider war der Service an diesem Tag nicht ganz so gut. Einer (immer die selbe Person) bekam das Essen leider immer erst mit einiger Verzgerung im vergleich zu den anderen beiden. rgerlich, schlielich mchte man ja zusammen speisen. Woran dies lag kann ich nicht sagen. An Stre in der Kche aber eher nicht da nur 3 oder 4 Tische besetzt waren. Der Nachschub mit Reis klappte dann wieder wunderbar.


	Das grte Manko an diesem Tag war ein nicht ordentlich gesuberter Tisch. Auf einem Platzset fanden sich z.B. noch Reiskrner vom Vorgnger - Nicht sehr lecker! Nachdem ich bei einem anderen, gerade frei gewordenen Tisch die Reinigungsprozedur beobachten konnte (einmal fix drber wischen) wusste ich aber, wie es zu diesem Malheur kommen konnte. Hier ist eindeutlich noch Verbesserungspotential vorhanden.


