Review.create!  :id => 976,  :organization_id => 341,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-02-18",  :body => "Wir gehen regelmig 2-3x im Monat und seit ber 18 Jahren zu Man Wah Familientradition.! Ich habe mich auch bereits damit abgefunden, dass das Personal bei Man Wah UNFREUNDLICH ist aber so etwas habe ich noch nicht erlebt, dies bertrifft alles.Unglaublich !
Als ich gestern mit meiner Familie bei Man Wah essen war, bestellte mein Mann bei der Kellnerin eine Cola ausdrcklich: ohne Eis und ohne Zitrone
Die Kellnerin kam mit einem Glas Cola mit einer Zitrone drinnen (nicht nur das die Zitrone nicht erwnscht war, nein, sie war schon alt, trocken und runzelig)
Mein Mann sagte daraufhin -Ich habe doch eine Cola ohne Zitrone bestellt.
Die Kellnerin nahm das Glas mit hoch gezogener Augenbraue und genervter Haltung zurck. Wir beobachteten wie die Zitrone aus dem Glas gefischt worden ist. Die Kellnerin kam mit dem Glas Cola zurck worauf ich sie fragte: Entschuldigen Sie, haben Sie gerade wirklich die Zitrone aus dem Glas rausgefischt? Daraufhin sagte sie: Ja, hm ist das ein Problem, was ist den losssss?! Mein Mann sagte daraufhin: Ich hatte eine Cola ohne Zitrone bestellt, die ganzen zerfallenen Zitronenstcke sind noch in der Cola drin! Aber sie liess meinen Mann gar nicht ausreden, sie kehrte ihm respektlos den Rcken zu, WHREND er noch mit ihr gesprochen hat.und das unglaubliche, ja wirklich unglaubliche, sie hob dazu noch die Hand, mit der Gestik mein Mann soll den Mund halten, sie will nichts mehr hren !!!!",  :rating => "1.0",  :processed => "",  :created_at => "2012-02-16 22:52:11 UTC",  :updated_at => "2012-02-16 22:52:11 UTC",  :reviewer_id => 821,  :review_provider_id => "1898430",  :title => "",  :review_url => ""
