Review.create!  :id => 982,  :organization_id => 341,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-07-11",  :body => "Strategisch gut schrg gegenber dem Esso-Parkhaus an der Reeperbahn gelegen, zog es uns zu einem Vor-Musical-Snack ins Man Wah. Es war zunchst etwas schwierig, das Restaurant zu entern, weil gerade am Haupteingang geliefert wurde, aber mit Gesten und Klopfen schafften wir es am Nebeneingang.


	Die Einrichtung ist glcklicherweise recht wenig deutsch-chinesisch: Der Mangel an Deko sagt , dass es hier ums Essen geht und nicht um Chichi.


	Interessant war zunchst die Menagerie: Gute Sojasauce, rosafarbener Essig und Sambal Badjak, also kein Standard sambal olek.


	Klar, es gibt auch hier die bei Deutsche beliebten 08/15-Gerichte, aber selbst die 31 (zweimal gebratenes Schweinefleisch, DAS Standardessen der Nordchinesen) meines Partners war wirklich gut und frisch zu bereitet. Die Sauce war lecker, nicht zu glibberig, das vielseitige Gemse (nicht nur Kohl)  knackig und das Schweinefleisch tatschlich rot gekocht und dann gebraten. Die mit einem satten Aufpreis servierte Bratnudeln waren ebensfalls gelungen.


	Ich hatte 3 Teile von der Vorspeisenkarten; es wrde Tage - oder einer Internet-Karte - bedrfen, alle mglichen Vor- und Hauptspeisekstlichkeiten aufzuzhlen; die Auswahl fiel schwer, aber letztendlich habe ich schweren Herzens die chinesischen Hauptspeisen aufs nchste Mal getagt :- A 14- A 12Was was war, wei ich nicht mehr, aber beide waren kstlich: Shrimps  gedmpft in Tofuhaut, und Baozi mit wrzig-ser Schweinefleischfllung)- A 31 (scharfer thailndischer Tintenfischsalat mit Koriandergrn; ein sauerscharfer Gaumenschmaus )


	Der Service ist geschftsmig trocken und effektiv, also sehr chinesisch. Wie gesagt, hier geht es ums Essen und nicht um chichi.


	Die Toiletten sind sauber.


	Fazit: Ich werde sicher fr die Spezialkarte der Hauptgerichte noch einmal vorbeischauen, denn hier gibt es interessant Welten zu entdecken. Schn, dass es das auf der Reeperbahn gibt ... odeer soll ich sagen, schn, dass es viele chinesische Besucher auf der Reeperbahn gibt, die heimatlich essen wollen ? Hoffentlich kann ich beim nchsten Mal den 5. Stern hinzufgen. Vielleicht mit anderen Qypern ?",  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:52:12 UTC",  :updated_at => "2012-02-16 22:52:12 UTC",  :reviewer_id => 827,  :review_provider_id => "2220945",  :title => "",  :review_url => ""
