Review.create!  :id => 992,  :organization_id => 327,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2012-01-25",  :body => "Das Ni HAO in Hamburg Wandsbek ist eine besondere Adresse. Nirgends in der Nhe existiert ein vergleichbarer Asiat in Hamburg Wandsbek. Dieser verzichtet ganz bewusst auf Goldfischteich, Kitschporzellan und fernstliche Musik vom Flieband, sondern kommt puristisch, modern, edel daher. Der Eingangsbereich verfgt ber eine groe Glasfront und das Restaurant ist sehr schlicht, edel die Tische minimal verunstaltet und bietet ca 40-50 Tische. Kaum hat man das Lokal betreten ist man in den Hnden eines ganzen chinesischen Hofstaates erfreulich gut geschulter und deutsch sprechender Angestellten. Professionell (dieses Wort trifft dieses Lokal meiner Meinung sehr gut) wird der Gast aus einer in Hamburg Wandsbek wohl einmaligen Weinsammlung (in der sich manch berdurchschnittliches bis hervorragendes Stck finden lsst)beraten und auch die Speisekarte macht Lust auf den Kaiserlichen Hof in Peking. Ob Frhlingsrollen, Wan-Tan oder ein knackiger Asia Salat. Alles frisch gemacht und keine TEKA Frhlingsrollen. Sehr gut jetzt habe ich Hunger wir bestellen Ente und Kaiserliches Gemse und werden nicht enttuscht. Der Kunde bekommt die Ente fachmnnisch am Tisch tranchiert und das Gemse zergeht beinahe auf der Zunge HERRLICH. Der Reis reicht fr eine Kompanie ausgehungerter Mnner aber das ist eine kleine Kritik. Drfte deutlich weniger sein. Auch die Desserts wie die Variation oder der Fruchtsalat wissen absolut zu berzeugen und als die erstaunlich moderate Rechnung kommt, habe ich kein Vllegefhl, sehr lecker gegessen, hatte einen sehr guten Service und bin einfach nur glcklich. Wir kommen immer wieder gerne ins NI HAO zurck!",  :rating => "5.0",  :processed => "",  :created_at => "2012-02-16 22:53:38 UTC",  :updated_at => "2012-02-16 22:53:38 UTC",  :reviewer_id => 837,  :review_provider_id => "2676576",  :title => "",  :review_url => ""
print "."
