Review.create!  :id => 996,  :organization_id => 327,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-12-21",  :body => "Das Essen schmeckt meiner Meinung nach nicht berdurchschnittlich gut, man bekommt aber durchaus lecker zubereitete Gerichte. Das Ambiente ist aber wirklich viel besser als in so manchem Asiatischen Restaurant in Hamburg. Der Service ist gut und die Atmosphre auch. Die Preise sind angemessen, etwas teurer als Bok zum Bespiel.",  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:53:38 UTC",  :updated_at => "2012-02-16 22:53:38 UTC",  :reviewer_id => 841,  :review_provider_id => "2604350",  :title => "",  :review_url => ""
