Review.create!  :id => 997,  :organization_id => 327,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-12-15",  :body => "Ich habe im Vergleich zu anderen Lnderkchen eher selten Appetit auf chinesisches Essen, aber wenn doch, gehe ich gerne ins Ni Hao. Ich war dort schon einige Male, meist zu mehreren, und das Essen war immer gut bis sehr gut und weit entfernt von dem Einheitszeug, das man in billigeren Chinarestaurants vorgesetzt bekommt. Das Restaurant als solches ist sehr gro, man bekommt eigentlich immer Pltze ohne Reservierung, die Einrichtung angenehm schlicht und nicht so berladen. Der Service ist sehr freundlich (mir schon zu sehr) und meistens fix. Einmal ist es uns trotzdem passiert, dass ein Kellner trotz 3maliger Erinnerung (!) das Wasser nicht brachte, das wir zum Wein bestellt hatten, das ist schon eine Leistung. Die Auswahl dort ist wirklich gro. Die Preise finde ich hoch, auch wenn man die Qualitt des Essens bercksichtigt und sind in letzter Zeit gefhlt noch mehr hochgegangen. Da ich mir nicht gerade Preise fr einzelne Gerichte gemerkt habe, kann ich es nicht mit Bestimmtheit sagen.Insgesamt gefllt es mir sehr gut, auch wenn ich eher selten dort bin und angesichts der Preise eher der Mittagstisch in Frage kommt, der etwas gnstiger ist.",  :rating => "4.0",  :processed => "",  :created_at => "2012-02-16 22:53:38 UTC",  :updated_at => "2012-02-16 22:53:38 UTC",  :reviewer_id => 842,  :review_provider_id => "2590543",  :title => "",  :review_url => ""
print "."
Review.create!  :id => 998,  :organization_id => 327,  :content_provider_id => 10,  :reviewer => "",  :reviewer_slug => "",  :review_date => "2011-12-11",  :body => "Gestern war ich mit meinem Grovater hier essen. Wir wurden sehr freundlich begrt und uns wurden sogar die Jacken abgenommen. Mein Grovater bestellte Ente Ananas, die so nicht mehr auf der Karte steht. Dies war aber gar kein Problem. Ich bestellte das Rinderfilet mit Pak Choi, was sehr gut war d.h. das Fleisch war ganz zart und das Gemse knackig. Ich durfte auch die Ente probieren, die oben knusprig und innen ganz zart war. Das Gericht wurde in der Ananas serviert mit der frischen Ananas, nicht wie bei anderen, die einfach Dosenananas verwenden. Alles in allem also ein ganz tolles Essen. Der Service war ausgesprochen freundlich, aufmerksam und zuvorkommend. Zum Abschluss gibt es dann noch ein heies Tuch, um sich die Hnde sauber zu machen und Pfefferminzbonbons. Wir kommen sehr gerne wieder.",  :rating => "5.0",  :processed => "",  :created_at => "2012-02-16 22:53:38 UTC",  :updated_at => "2012-02-16 22:53:38 UTC",  :reviewer_id => 843,  :review_provider_id => "2581863",  :title => "",  :review_url => ""
print "."
